webpackJsonp([0xdcb4d9b5a7cd],{4580:function(n,a){n.exports={data:{markdownRemark:{html:'<p>The <code>push()</code> method is used to add one or more new elements to the end of an array.\nIt also returns the new length of the array.</p>\n<h3>Syntax</h3>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code>arr<span class="token punctuation">.</span><span class="token function">push</span><span class="token punctuation">(</span><span class="token punctuation">[</span>element1<span class="token punctuation">[</span><span class="token punctuation">,</span> <span class="token operator">...</span><span class="token punctuation">[</span><span class="token punctuation">,</span> elementN<span class="token punctuation">]</span><span class="token punctuation">]</span><span class="token punctuation">]</span><span class="token punctuation">)</span>\n</code></pre>\n      </div>\n<h3>Parameters</h3>\n<ul>\n<li><strong>elementN</strong> The elements to add to the end of the array.</li>\n</ul>\n<h3>Return value</h3>\n<p>The new length of the array on which the method was called.</p>\n<h2>Description</h2>\n<p>The <code>push()</code> method will <em>push</em> elements to the end of an array. It can take zero or more arguments. If no arguments are provided,\nit will simply return the current length of the array. If provided one or more arguments, it will add these arguments to the array\nin the order in which they are written.</p>\n<p>This method also returns the new length of the array after the element(s) are pushed to it.</p>\n<h2>Example:</h2>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code><span class="token keyword">var</span> myStarkFamily <span class="token operator">=</span> <span class="token punctuation">[</span><span class="token string">\'John\'</span><span class="token punctuation">,</span> <span class="token string">\'Robb\'</span><span class="token punctuation">,</span> <span class="token string">\'Sansa\'</span><span class="token punctuation">,</span> <span class="token string">\'Bran\'</span><span class="token punctuation">]</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>Suppose you have an array of the children of House Stark from Game of Thrones. However, one of the members, <strong>Arya</strong>, is missing.\nKnowing the code above, you could add her by assigning <code>\'Arya\'</code> to the array at the index after the last index like so:</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code>myStarkFamily<span class="token punctuation">[</span><span class="token number">4</span><span class="token punctuation">]</span> <span class="token operator">=</span> <span class="token string">\'Arya\'</span><span class="token punctuation">;</span>\n</code></pre>\n      </div>\n<p>The problem with this solution is that it can’t handle general cases. If you didn’t know beforehand what the length of the array is,\nyou can’t add new elements this way. This is what <code>push()</code> is for. We don’t need to know how long the array is. We just add\nour element to the end of the array.</p>\n<div class="gatsby-highlight">\n      <pre class="language-javascript"><code>myStarkFamily<span class="token punctuation">.</span><span class="token function">push</span><span class="token punctuation">(</span><span class="token string">\'Arya\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>myStarkFamily<span class="token punctuation">)</span><span class="token punctuation">;</span>  <span class="token comment" spellcheck="true">// [\'John\', \'Robb\', \'Sansa\', \'Bran\', \'Arya\']</span>\n\n<span class="token keyword">var</span> newLength <span class="token operator">=</span> myStarkFamily<span class="token punctuation">.</span><span class="token function">push</span><span class="token punctuation">(</span><span class="token string">\'Rickon\'</span><span class="token punctuation">)</span><span class="token punctuation">;</span>  <span class="token comment" spellcheck="true">// oops! forgot Rickon</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>newLength<span class="token punctuation">)</span><span class="token punctuation">;</span>  <span class="token comment" spellcheck="true">// 6</span>\nconsole<span class="token punctuation">.</span><span class="token function">log</span><span class="token punctuation">(</span>myStarkFamily<span class="token punctuation">)</span><span class="token punctuation">;</span>  <span class="token comment" spellcheck="true">// [\'John\', \'Robb\', \'Sansa\', \'Bran\', \'Arya\', \'Rickon\']</span>\n</code></pre>\n      </div>\n<h4>More Information:</h4>\n<p><a href="https://developer.mozilla.org/en-US/docs/Web/JavaScript/Reference/Global_Objects/Array/push">MDN</a></p>',fields:{slug:"/javascript/standard-objects/array/array-prototype-push/"},frontmatter:{title:"Array.prototype.push"}}},pathContext:{slug:"/javascript/standard-objects/array/array-prototype-push/"}}}});
